const FormComponent =()=>{
    return(
        <div className="comtainer p-5">
            <h1>เขียนบทความ</h1>
            <form>
                <div className="form-group">
                    <label>ชื่อบทความ</label>
                    
                </div>
            </form>
        </div>
    )
}
export default FormComponent;
